import React from 'react';
import Navbar from './Navbar/Navbar';
import './Index.css';


function Portfolio() {
  return (
    <>
    <Router>
                                <Routes>
                                    <Route path='/' element={<Project/>}/>
                                </Routes>
                            </Router>
    <Navbar/>
    </>
  )
}

export default Portfolio
